import styled from "styled-components";
import DataItem from "components/shared/DataItem";
import Time from "public/assets/img/layout/icons/time.svg";

const items = [{
title : "Prepárate para el futuro",
description : "Analizar los escenarios que podrían ocurrir a corto y largo plazo te ayudará a organizar la información que necesitas para enfrentar nuevas problemáticas y reducir riesgos.",
icon : <Time/> 
}
];

function DataItemsWhite() {
  return (
      <DataItem title={items[0].title}/>
  );
}

export default DataItemsWhite;

const Column = styled.div`
grid-column-end: span 1;
`;

const ColumnSecond = styled.div`
grid-column-end: span 1;
`;
